import React from "react";
import cartIcon from "../cart.svg";

const Cart = () => {
	return (
		<p
			style={{
				marginTop: "3px",
			}}>
			<img src={cartIcon} height="30" alt="cart icon" />
			<span className="badge badge-light">0</span>
		</p>
	);
};

export default Cart;
